/* SYNTAX VARIABLES */
/* COLOR PALETTE */
/*
  OPEN COLOR 1.6.2
  by yeun
  github.com/yeun/open-color
*/
.github-StubItem-git-tab-controller,
.github-GitTabItem-root {
  flex: 1;
  display: flex;
}
.github-Panel {
  flex: 1;
  display: flex;
  flex-direction: column;
  min-width: 0;
  font-family: 'BlinkMacSystemFont', 'Lucida Grande', 'Segoe UI', Ubuntu, Cantarell, sans-serif;
  font-size: 13px;
  color: #b6b6bf;
  -webkit-user-select: none;
  cursor: default;
}
.github-Panel.no-repository {
  padding: 36px;
  text-align: center;
}
.github-Panel.is-loading {
  color: #626274;
}
.github-Panel.no-repository {
  display: flex;
  justify-content: center;
  font-size: 1.25em;
}
.github-Panel.no-repository > * {
  margin: 12px 0;
}
.github-Panel.no-repository .git-logo-path {
  fill: #57576b;
}
.github-Panel.no-repository .btn.btn-primary {
  overflow: hidden;
  text-overflow: ellipsis;
}
atom-dock.bottom .github-Panel {
  flex-direction: row;
}
atom-dock.bottom .github-StagingView {
  display: contents;
}
atom-dock.bottom .github-Panel > div {
  flex: 1;
}
atom-dock.bottom .github-StagedChanges {
  border-left: 1px solid #363659;
  border-right: 1px solid #363659;
}
atom-dock.bottom .github-StagingView-header {
  flex-wrap: wrap;
}
atom-dock.bottom .github-StagingView-group:first-child .github-StagingView-header {
  border-top: 1px solid #363659;
}
atom-dock.bottom .github-RecentCommits {
  max-height: none;
  border-left: 1px solid #363659;
}
